import React from "react";

const TestCertificates = () => {
  return (
    <div
      style={{
        padding: "20px",
        backgroundColor: "#f0f0f0",
        minHeight: "400px",
        border: "2px solid red",
      }}
    >
      <h1 style={{ color: "red", fontSize: "24px", marginBottom: "20px" }}>
        TESTE - PÁGINA DE CERTIFICADOS
      </h1>
      <p style={{ color: "blue", fontSize: "16px", marginBottom: "20px" }}>
        Se você está vendo esta mensagem, a página está renderizando
        corretamente.
      </p>

      <div
        style={{
          backgroundColor: "white",
          padding: "20px",
          margin: "20px 0",
          border: "1px solid #ccc",
          borderRadius: "8px",
        }}
      >
        <h2 style={{ color: "green", marginBottom: "10px" }}>Certificado 1</h2>
        <p>Distribuição de Alimentos - Associação Futuro Brilhante</p>
        <p>8 horas - 20/12/2023</p>
        <button
          style={{
            backgroundColor: "green",
            color: "white",
            padding: "10px 20px",
            border: "none",
            borderRadius: "4px",
            marginTop: "10px",
          }}
        >
          Baixar Certificado
        </button>
      </div>

      <div
        style={{
          backgroundColor: "yellow",
          padding: "10px",
          marginTop: "20px",
          border: "2px solid red",
        }}
      >
        <strong>Status: PÁGINA FUNCIONANDO ✅</strong>
      </div>
    </div>
  );
};

export default TestCertificates;
